"use strict";$(document).ready(function(){$("#select").on("change",function(){var e=$("#select").val();$.ajax({method:"get",url:"https://api.nytimes.com/svc/topstories/v2/"+e+".json?api-key=284e1a4e58644ff8b5c13eb355b79961"}).done(function(e){$(".results").empty(),$(".loading").show();var t=e.results.filter(function(e){return e.multimedia.length}).slice(0,12);$.each(t,function(e,t){console.log(t),$(".results").append('<div class="article-wrapper">\n           <a href="'+t.url+'">\n           <div class="article-abstract-wrapper">\n           <div class="article" style="background:url('+t.multimedia[4].url+');background-size:cover;background-position:center">\n           <div class="please"><p class="snippet">'+t.abstract+"</p></div></div>\n        </div>\n        </div></a>")})})})});